import React from 'react';
import ReactDOM from 'react-dom';
import { ShoppingList } from './views'

function App() {
    return (
        <div id="app">
            <main><ShoppingList /></main>
            <aside>Some text</aside>
        </div>
    );
}

ReactDOM.render(<App />, document.getElementById('root'));
